var canvas = document.getElementById('canvas'),
    canvasLeft = canvas.offsetLeft + canvas.clientLeft,
    canvasTop = canvas.offsetTop + canvas.clientTop,
    ctx = canvas.getContext('2d'),
    elements = [];


    console.log(`😀-canvas.offsetLeft-😀 : ${canvas.offsetLeft}`)
    console.log(`😀-canvas.clientLeft-😀 : ${canvas.clientLeft}`)
    console.log(`😀-canvasLeft-😀 : ${canvasLeft}`)
    console.log(`😀-canvasTop-😀 : ${canvasTop}`)

// Add event listener for `click` events.
canvas.addEventListener('click', function(event) {
    var x = event.pageX - canvasLeft,
        y = event.pageY - canvasTop;

        console.log(`😀-event.pageX-😀 : ${event.pageX}`)
        console.log(`😀-event.pageY-😀 : ${event.pageY}`)
        console.log(`😀-x-😀 : ${x}`)
        console.log(`😀-y-😀 : ${y}`)

    // Collision detection between clicked offset and element.
    elements.forEach(function(element) {
        if (y > element.top && y < element.top + element.height 
            && x > element.left && x < element.left + element.width) {
            alert('clicked an element');
        }
    });

}, false);

// Add element.
elements.push({
    colour: '#05EFFF',
    width: 150,
    height: 100,
    top: 20,
    left: 15
});

// Render elements.
elements.forEach(function(element) {
    ctx.fillStyle = element.colour;
    ctx.fillRect(element.left, element.top, element.width, element.height);
});










